const SHIMMER = -1;       // -1 for off, or 2-5 for shimmer intensity

const PATTERN_SIZE = 800; // Size of the pattern itself
const FRAME_SIZE = 1600;  // Size of the Figma frame
const PADDING = (FRAME_SIZE - PATTERN_SIZE) / 2; // Padding around frame

// ============ TYPES ============
type Point = { x: number; y: number };
type Affine = [number, number, number, number, number, number];
type Box = { x: number; y: number; w: number; h: number };
type Line = { pos: Point; dir: Point };
type Tile = { vertex: Point; path: Point[] };

// ============ GEOMETRY FUNCTIONS ============
function makePoint(x: number, y: number): Point {
  return { x, y };
}

function makeAffine(a: number, b: number, c: number, d: number, e: number, f: number): Affine {
  return [a, b, c, d, e, f];
}

function makeBox(x: number, y: number, w: number, h: number): Box {
  return { x, y, w, h };
}

function pointAdd(p: Point, q: Point): Point {
  return { x: p.x + q.x, y: p.y + q.y };
}

function pointSub(p: Point, q: Point): Point {
  return { x: p.x - q.x, y: p.y - q.y };
}

function pointScale(p: Point, a: number): Point {
  return { x: p.x * a, y: p.y * a };
}

function dot(p: Point, q: Point): number {
  return p.x * q.x + p.y * q.y;
}

function pointDist(p: Point, q: Point): number {
  const dx = p.x - q.x;
  const dy = p.y - q.y;
  return Math.sqrt(dx * dx + dy * dy);
}

function inv(T: Affine): Affine {
  const det = T[0] * T[4] - T[1] * T[3];
  return makeAffine(
    T[4] / det, -T[1] / det, (T[1] * T[5] - T[2] * T[4]) / det,
    -T[3] / det, T[0] / det, (T[2] * T[3] - T[0] * T[5]) / det
  );
}

function mul(A: Affine, B: Affine | Point): Affine | Point {
  if ('x' in B) {
    // Matrix * Point
    return {
      x: A[0] * B.x + A[1] * B.y + A[2],
      y: A[3] * B.x + A[4] * B.y + A[5]
    };
  } else {
    // Matrix * Matrix
    return [
      A[0] * B[0] + A[1] * B[3],
      A[0] * B[1] + A[1] * B[4],
      A[0] * B[2] + A[1] * B[5] + A[2],
      A[3] * B[0] + A[4] * B[3],
      A[3] * B[1] + A[4] * B[4],
      A[3] * B[2] + A[4] * B[5] + A[5]
    ];
  }
}

function matchSeg(p: Point, q: Point): Affine {
  return makeAffine(
    q.x - p.x, p.y - q.y, p.x,
    q.y - p.y, q.x - p.x, p.y
  );
}

function matchTwoSegs(p1: Point, q1: Point, p2: Point, q2: Point): Affine {
  return mul(matchSeg(p2, q2), inv(matchSeg(p1, q1))) as Affine;
}

function fillBox(b1: Box, b2: Box, rot: boolean): Affine {
  const sc = Math.min(b2.w / b1.w, b2.h / b1.h);
  const rsc = Math.min(b2.w / b1.h, b2.h / b1.w);

  if (!rot || (sc > rsc)) {
    return mul(
      makeAffine(1, 0, b2.x + 0.5 * b2.w, 0, 1, b2.y + 0.5 * b2.h),
      mul(
        makeAffine(sc, 0, 0, 0, sc, 0),
        makeAffine(1, 0, -(b1.x + 0.5 * b1.w), 0, 1, -(b1.y + 0.5 * b1.h))
      ) as Affine
    ) as Affine;
  } else {
    return mul(
      makeAffine(1, 0, b2.x + 0.5 * b2.w, 0, 1, b2.y + 0.5 * b2.h),
      mul(
        mul(
          makeAffine(rsc, 0, 0, 0, rsc, 0),
          makeAffine(0, -1, 0, 1, 0, 0)
        ) as Affine,
        makeAffine(1, 0, -(b1.x + 0.5 * b1.w), 0, 1, -(b1.y + 0.5 * b1.h))
      ) as Affine
    ) as Affine;
  }
}

function groupTiles(tiles: Point[][]): Point[] {
  let segs: [Point, Point][] = [];
  
  for (const t of tiles) {
    const len = t.length;
    for (let idx = 0; idx < len; ++idx) {
      const P = t[idx];
      const Q = t[(idx + 1) % len];
      let found = -1;

      for (let sidx = 0; sidx < segs.length; ++sidx) {
        const s = segs[sidx];
        if ((pointDist(s[0], Q) < 0.0001) && (pointDist(s[1], P) < 0.0001)) {
          found = sidx;
          break;
        }
      }

      if (found >= 0) {
        segs.splice(found, 1);
      } else {
        segs.push([P, Q]);
      }
    }
  }

  const ret: Point[] = [segs[0][0]];
  let last = segs[0][1];
  segs = segs.slice(1);

  while (segs.length > 0) {
    for (let idx = 0; idx < segs.length; ++idx) {
      if (pointDist(segs[idx][0], last) < 0.0001) {
        ret.push(segs[idx][0]);
        last = segs[idx][1];
        segs.splice(idx, 1);
        break;
      }
    }
  }

  return ret;
}

