// ============ COLOR UTILITIES ============
function hsbToRgb(h: number, s: number, b: number): { r: number; g: number; b: number } {
  h = h / 100;
  s = s / 100;
  b = b / 100;
  
  const k = (n: number) => (n + h * 6) % 6;
  const f = (n: number) => b * (1 - s * Math.max(0, Math.min(k(n), 4 - k(n), 1)));
  
  return {
    r: f(5),
    g: f(3),
    b: f(1)
  };
}

function initColours(): { r: number; g: number; b: number }[] {
  return [
    hsbToRgb(Math.random() * 100, Math.random() * 100, Math.random() * 30),
    hsbToRgb(Math.random() * 100, Math.random() * 10, 100 - Math.random() * 5),
    hsbToRgb(Math.random() * 100, Math.random() * 50 + 25, Math.random() * 50 + 25),
    hsbToRgb(Math.random() * 100, Math.random() * 50 + 25, Math.random() * 50 + 25),
    hsbToRgb(Math.random() * 100, Math.random() * 50 + 25, Math.random() * 50 + 25)
  ];
}

function randomizeColor(col: { r: number; g: number; b: number }, shimmer: number): { r: number; g: number; b: number } {
  if (shimmer < 0) return col;
  
  const amount = (Math.random() - 0.5) * 0.2;
  return {
    r: Math.max(0, Math.min(1, col.r + amount)),
    g: Math.max(0, Math.min(1, col.g + amount)),
    b: Math.max(0, Math.min(1, col.b + amount))
  };
}

// ============ GRID CLASS ============
const GRID_SIDE = (2 * LINE_DENSITY) + 1;

const ordered_dirs = [5, 2, 1, 0, 3, 6, 7, 8];
const r22 = Math.sqrt(2.0) * 0.5;
const int_dir_vecs = [
  makePoint(-1, -1), makePoint(0, -1), makePoint(1, -1),
  makePoint(-1, 0), makePoint(0, 0), makePoint(1, 0),
  makePoint(-1, 1), makePoint(0, 1), makePoint(1, 1)
];
const dir_vecs = [
  makePoint(-r22, -r22), makePoint(0, -1), makePoint(r22, -r22),
  makePoint(-1, 0), makePoint(0, 0), makePoint(1, 0),
  makePoint(-r22, r22), makePoint(0, 1), makePoint(r22, r22)
];

class Grid {
  data: Array<{ users: Line[]; drawn: boolean; group: number }>;

  constructor() {
    this.data = [];
    for (let idx = 0; idx < GRID_SIDE * GRID_SIDE; ++idx) {
      this.data.push({ users: [], drawn: false, group: -1 });
    }
  }

  getCell(pt: Point) {
    return this.data[pt.y * GRID_SIDE + pt.x];
  }

  getUsers(pt: Point): Line[] {
    return this.getCell(pt).users;
  }

  numUsers(pt: Point): number {
    return this.getUsers(pt).length;
  }

  addUser(pt: Point, line: Line) {
    this.getCell(pt).users.push(line);
  }

  isDrawn(pt: Point): boolean {
    return this.getCell(pt).drawn;
  }

  setDrawn(pt: Point) {
    this.getCell(pt).drawn = true;
  }

  getGroup(pt: Point): number {
    return this.getCell(pt).group;
  }

  setGroup(pt: Point, g: number) {
    this.getCell(pt).group = g;
  }

  markRay(line: Line, pos: Point, dir: Point) {
    while ((pos.x >= 0) && (pos.x < GRID_SIDE) && (pos.y >= 0) && (pos.y < GRID_SIDE)) {
      this.addUser(pos, line);
      pos = pointAdd(pos, dir);
    }
  }

  markLine(line: Line) {
    const p = line.pos;
    const d = line.dir;
    this.markRay(line, p, d);
    this.markRay(line, pointSub(p, d), pointScale(d, -1));
  }

  markLines(lines: Line[]) {
    for (const l of lines) {
      this.markLine(l);
    }
  }

  findNeighbour(pt: Point, dir: Point): Point | null {
    pt = pointAdd(pt, dir);
    while ((pt.x >= 0) && (pt.x < GRID_SIDE) && (pt.y >= 0) && (pt.y < GRID_SIDE)) {
      if (this.numUsers(pt) > 1) {
        return pt;
      }
      pt = pointAdd(pt, dir);
    }
    return null;
  }
}

// ============ LINE GENERATION ============
function createLines(num: number): { lines: Line[]; groups: Point[][] } {
  let all_lines: Line[] = [];
  const keep_lines: Line[] = [];
  const groups: Point[][] = [];

  function makeLine(pos: Point, dir: Point): Line {
    return { pos, dir };
  }

  function makeAllLines(n: number) {
    for (let i = 0; i < n + 1; ++i) {
      all_lines.push(makeLine(makePoint(0, 2 * i), makePoint(1, 0)));
    }
    for (let i = 0; i < n + 1; ++i) {
      all_lines.push(makeLine(makePoint(2 * i, 0), makePoint(0, 1)));
    }
    for (let i = 0; i < n + 1; ++i) {
      all_lines.push(makeLine(makePoint(2 * n, 2 * i), makePoint(-1, -1)));
    }
    for (let i = 0; i < n; ++i) {
      all_lines.push(makeLine(makePoint(0, 2 * i + 2), makePoint(1, 1)));
    }
    for (let i = 0; i < n + 1; ++i) {
      all_lines.push(makeLine(makePoint(0, 2 * i), makePoint(1, -1)));
    }
    for (let i = 0; i < n; ++i) {
      all_lines.push(makeLine(makePoint(2 * i + 2, 2 * n), makePoint(1, -1)));
    }
  }

  function makeRandom2x2(n: number) {
    if (Math.random() < 0.5) {
      const ax = Math.floor(Math.random() * n);
      const ay = Math.floor(Math.random() * n);

      const rem: number[] = [];
      for (let i = 0; i < 3; ++i) {
        const k = (2 * n + 2) + (n - 1) + ax - ay;
        if ((k >= 2 * n + 2) && (k < 4 * n + 3)) {
          rem.push(k);
        }
      }
      for (let i = 0; i < 3; ++i) {
        rem.push(4 * n + 3 + i + ax + ay);
      }

      rem.reverse();
      for (const i of rem) {
        all_lines.splice(i, 1);
      }

      groups.push([makePoint(2 * ay, 2 * ax), makePoint(2 * ay + 2, 2 * ax),
        makePoint(2 * ay, 2 * ax + 2), makePoint(2 * ay + 2, 2 * ax + 2)]);

      for (const i of [n + 1 + ay + 1, n + 1 + ay, ax + 1, ax]) {
        keep_lines.push(all_lines[i]);
        all_lines.splice(i, 1);
      }
    } else {
      const a = Math.floor(Math.random() * n);
      const b = Math.floor(Math.random() * (n - 1)) + 1;

      if (Math.random() < 0.5) {
        all_lines.splice(n + 1 + a + 1, 1);
        all_lines.splice(n + 1 + a, 1);
        all_lines.splice(b, 1);
        groups.push([makePoint(2 * a + 1, 2 * b - 1), makePoint(2 * a + 1, 2 * b + 1),
          makePoint(2 * a, 2 * b), makePoint(2 * a + 2, 2 * b)]);

        for (const i of [4 * n + a + b + 1, 4 * n + a + b, 3 * n - 1 + b - a, 3 * n - 2 + b - a]) {
          keep_lines.push(all_lines[i]);
          all_lines.splice(i, 1);
        }
      } else {
        all_lines.splice(n + 1 + b, 1);
        all_lines.splice(a + 1, 1);
        all_lines.splice(a, 1);
        groups.push([makePoint(2 * b, 2 * a), makePoint(2 * b, 2 * a + 2),
          makePoint(2 * b - 1, 2 * a + 1), makePoint(2 * b + 1, 2 * a + 1)]);

        for (const i of [4 * n + a + b + 1, 4 * n + a + b, 3 * n + a - b, 3 * n - 1 + a - b]) {
          keep_lines.push(all_lines[i]);
          all_lines.splice(i, 1);
        }
      }
    }
  }

	// Add this INSIDE the createLines function, after makeRandom2x2:

	function makeRandomStar(n: number) {
		const ax = Math.floor(Math.random() * (n - 4)) + 2;
		const ay = Math.floor(Math.random() * (n - 4)) + 2;

		const plan = [
			{ idx: 4 * n + 7 + ax + ay, keep: false },
			{ idx: 4 * n + 6 + ax + ay, keep: true },
			{ idx: 4 * n + 5 + ax + ay, keep: false },
			{ idx: 4 * n + 4 + ax + ay, keep: false },
			{ idx: 4 * n + 3 + ax + ay, keep: false },
			{ idx: 4 * n + 2 + ax + ay, keep: true },
			{ idx: 4 * n + 1 + ax + ay, keep: false },
			{ idx: 3 * n + 5 + ax - ay, keep: false },
			{ idx: 3 * n + 4 + ax - ay, keep: true },
			{ idx: 3 * n + 3 + ax - ay, keep: false },
			{ idx: 3 * n + 2 + ax - ay, keep: false },
			{ idx: 3 * n + 1 + ax - ay, keep: false },
			{ idx: 3 * n + 0 + ax - ay, keep: true },
			{ idx: 3 * n - 1 + ax - ay, keep: false },
			{ idx: n + 1 + ay + 2, keep: true },
			{ idx: n + 1 + ay + 1, keep: false },
			{ idx: n + 1 + ay, keep: false },
			{ idx: n + 1 + ay - 1, keep: true },
			{ idx: ax + 2, keep: true },
			{ idx: ax + 1, keep: false },
			{ idx: ax, keep: false },
			{ idx: ax - 1, keep: true }
		];

		for (const step of plan) {
			if (step.keep) {
				keep_lines.push(all_lines[step.idx]);
			}
			all_lines.splice(step.idx, 1);
		}

		groups.push([
			makePoint(2 * ay + 1, 2 * ax - 3),
			makePoint(2 * ay - 2, 2 * ax - 2),
			makePoint(2 * ay, 2 * ax - 2),
			makePoint(2 * ay + 2, 2 * ax - 2),
			makePoint(2 * ay + 4, 2 * ax - 2),
			makePoint(2 * ay - 2, 2 * ax),
			makePoint(2 * ay + 4, 2 * ax),
			makePoint(2 * ay - 3, 2 * ax + 1),
			makePoint(2 * ay + 5, 2 * ax + 1),
			makePoint(2 * ay - 2, 2 * ax + 2),
			makePoint(2 * ay + 4, 2 * ax + 2),
			makePoint(2 * ay - 2, 2 * ax + 4),
			makePoint(2 * ay, 2 * ax + 4),
			makePoint(2 * ay + 2, 2 * ax + 4),
			makePoint(2 * ay + 4, 2 * ax + 4),
			makePoint(2 * ay + 1, 2 * ax + 5)
		]);
	}

  makeAllLines(LINE_DENSITY);
  if (FOCUS === 'Eight') {
    makeRandom2x2(LINE_DENSITY);
  } else if (FOCUS === 'Sixteen') {
		makeRandomStar(LINE_DENSITY);
	}

  num -= keep_lines.length;

  while ((all_lines.length > 0) && (num > 0)) {
    const ri = Math.floor(Math.random() * all_lines.length);
    keep_lines.push(all_lines[ri]);
    all_lines.splice(ri, 1);
    --num;
  }

  return { lines: keep_lines, groups };
}

// ============ TILE EXTRACTION ============
function getAllTiles(grid: Grid): { tiles: Tile[]; boundary: Point[] } {
  const L: Tile[] = [];
  const B: Point[] = [];

  let spt: Point | null = null;

  for (let y = 0; y < GRID_SIDE; ++y) {
    for (let x = 0; x < GRID_SIDE; ++x) {
      const pt = makePoint(x, y);
      if (grid.numUsers(pt) >= 2) {
        spt = pt;
        break;
      }
    }
    if (spt != null) break;
  }

  if (!spt) return { tiles: [], boundary: [] };

  const stack: Array<{ pos: Point; ap: Point | null; aq: Point | null }> = [{ pos: spt, ap: null, aq: null }];

  while (stack.length > 0) {
    const a = stack.pop()!;
    const pt = a.pos;

    if (grid.isDrawn(pt)) continue;

    const align_p = a.ap;
    const align_q = a.aq;
    const us = grid.getUsers(pt);
    const pts: Point[] = [];

    grid.setDrawn(pt);

    const used_dirs = new Set<number>();

    for (const l of us) {
      const d = l.dir;
      used_dirs.add((d.y + 1) * 3 + (d.x + 1));
      used_dirs.add((-d.y + 1) * 3 + (-d.x + 1));
    }

    let last = makePoint(0, 0);
    for (const d of ordered_dirs) {
      if (used_dirs.has(d)) {
        const ddir = dir_vecs[d];
        const ppdir = makePoint(-ddir.y, ddir.x);
        const npt = pointAdd(last, ppdir);
        pts.push(last);
        last = npt;
      }
    }

    let translation = makePoint(0, 0);
    if (align_p != null && align_q != null) {
      const delt = pointSub(align_p, align_q);
      for (let idx = 0; idx < pts.length; ++idx) {
        const v = pointSub(pts[(idx + 1) % pts.length], pts[idx]);
        if (pointDist(v, delt) < 1e-5) {
          translation = pointSub(align_q, pts[idx]);
          break;
        }
      }
    }

    for (let idx = 0; idx < pts.length; ++idx) {
      pts[idx] = pointAdd(pts[idx], translation);
    }

    L.push({ vertex: pt, path: pts });

    let vidx = 0;
    for (const d of ordered_dirs) {
      if (used_dirs.has(d)) {
        const neigh = grid.findNeighbour(pt, int_dir_vecs[d]);
        if (neigh != null) {
          if (!grid.isDrawn(neigh)) {
            stack.push({ pos: neigh, ap: pts[vidx], aq: pts[(vidx + 1) % pts.length] });
          }
        } else {
          B.push(pts[vidx]);
          B.push(pts[(vidx + 1) % pts.length]);
        }
        vidx = vidx + 1;
      }
    }
  }

  return { tiles: L, boundary: B };
}

// ============ TILE SIGNATURE ============
function getSignature(t: Point[]): string {
  const l = t.length;
  let ret = '';

  for (let i = 0; i < l; ++i) {
    const a = t[(i + l - 1) % l];
    const b = t[i];
    const c = t[(i + 1) % l];
    const s = dot(pointSub(a, b), pointSub(c, b));
    
    if (Math.abs(s) < 0.0001) {
      ret = ret + 'L';
    } else if (Math.abs(1 + s) < 0.0001) {
      ret = ret + 'I';
    } else if (s > 0) {
      ret = ret + 'V';
    } else {
      ret = ret + 'C';
    }
  }

  return ret;
}

// ============ FIGMA RENDERING ============
function pointsToSVGPath(points: Point[]): string {
  if (points.length === 0) return '';
  
  let path = `M ${points[0].x} ${points[0].y}`;
  for (let i = 1; i < points.length; i++) {
    path += ` L ${points[i].x} ${points[i].y}`;
  }
  path += ' Z';
  return path;
}

function createFigmaShape(M: Affine, shape: any, colors: { r: number; g: number; b: number }[]): VectorNode {
  const pth = shape.path;
  const col = shape.colour;

  const transformedPoints: Point[] = [];
  for (let idx = 0; idx < pth.length; idx += 2) {
    const spt = mul(M, makePoint(pth[idx], pth[idx + 1])) as Point;
    transformedPoints.push(spt);
  }

  const vector = figma.createVector();
  vector.vectorPaths = [{
    windingRule: "NONZERO",
    data: pointsToSVGPath(transformedPoints)
  }];

  const fillColor = randomizeColor(colors[col], SHIMMER);
  vector.fills = [{ type: 'SOLID', color: fillColor }];

  return vector;
}

function drawTile(M: Affine, t: Point[], colors: { r: number; g: number; b: number }[]): VectorNode[] {
  const vectors: VectorNode[] = [];
  let lt = [...t];
  const rl = Math.floor(Math.random() * lt.length);
  lt = lt.slice(rl).concat(lt.slice(0, rl));
  let sig = getSignature(lt);
  let found = false;

  for (let idx = 0; idx < sig.length; ++idx) {
    if (fillers.hasOwnProperty(sig)) {
      found = true;
      break;
    }
    lt = lt.slice(1).concat(lt.slice(0, 1));
    sig = sig.slice(1).concat(sig.slice(0, 1));
  }

  if (!found) {
    // No filler pattern - just draw solid tile
    const transformedPoints: Point[] = [];
    for (const pt of t) {
      transformedPoints.push(mul(M, pt) as Point);
    }
    
    const vector = figma.createVector();
    vector.vectorPaths = [{
      windingRule: "NONZERO",
      data: pointsToSVGPath(transformedPoints)
    }];
    
    const fillColor = randomizeColor(colors[2], SHIMMER);
    vector.fills = [{ type: 'SOLID', color: fillColor }];
		vectors.push(vector);
    return;
  }

  const clusters = fillers[sig];
  const cl = clusters[Math.floor(Math.random() * clusters.length)];
  const bds = cl.bounds;
  const fv = makePoint(bds[0], bds[1]);
  const fw = makePoint(bds[2], bds[3]);

  const T = mul(M, matchTwoSegs(fv, fw, lt[0], lt[1])) as Affine;

  for (const sh of cl.shapes) {
    const vector = createFigmaShape(T, sh, colors);
		vectors.push(vector);
  }
	return vectors;
}

// Finds empty space on canvas by looking at rightmost edge of all existing nodes
// Returns coordinates where next pattern should be placed
function findEmptySpace(): { x: number; y: number } {
  const nodes = figma.currentPage.children;
  let maxX = 0;
  
  for (const node of nodes) {
    const rightEdge = node.x + node.width;
    if (rightEdge > maxX) {
      maxX = rightEdge;
    }
  }
  
  // Shift to the right and return coordinates
  return { x: maxX, y: 0 };
}

// ============ MAIN RENDER FUNCTION ============
function render() {
  const colors = initColours();
  const lineinfo = createLines(NUM_LINES);
  const lines = lineinfo.lines;
  const groups = lineinfo.groups;
  
  const grid = new Grid();
  grid.markLines(lines);

  let all = getAllTiles(grid);
  let tiles = all.tiles;
  const boundary = all.boundary;

  // Group tiles
  for (let idx = 0; idx < groups.length; ++idx) {
    for (const pt of groups[idx]) {
      grid.setGroup(pt, idx);
    }
    const grouptiles: Point[][] = [];
    for (let tidx = tiles.length - 1; tidx >= 0; --tidx) {
      const t = tiles[tidx];
      if (grid.getGroup(t.vertex) === idx) {
        grouptiles.push(t.path);
        tiles.splice(tidx, 1);
      }
    }
    const newtile = groupTiles(grouptiles);
    tiles.push({ vertex: makePoint(0, 0), path: newtile });
  }

  // Calculate bounds
  let xmin = 100000.0, xmax = -100000.0;
  let ymin = 100000.0, ymax = -100000.0;

  for (const pt of boundary) {
    xmin = Math.min(xmin, pt.x);
    xmax = Math.max(xmax, pt.x);
    ymin = Math.min(ymin, pt.y);
    ymax = Math.max(ymax, pt.y);
  }

  const cbox = makeBox(xmin, ymin, xmax - xmin, ymax - ymin);
  const sbox = makeBox(PADDING, PADDING, PATTERN_SIZE, PATTERN_SIZE);
  const M = fillBox(cbox, sbox, false);
	  // Find whitespace to the right of existing patterns
  const position = findEmptySpace();

  const allVectors: VectorNode[] = [];
  for (const t of tiles) {
    const vectors = drawTile(M, t.path, colors);
    allVectors.push(...vectors);
  }

  // Add vectors to canvas at the calculated position
  for (const v of allVectors) {
    v.x = v.x + position.x;
    v.y = v.y + position.y;
    figma.currentPage.appendChild(v);
  }
  
  // figma.currentPage.selection = allVectors;
  figma.viewport.scrollAndZoomIntoView(allVectors);
}

